import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六辛日己亥时断</p><p>六辛日生时己亥，背禄剥官反破伤；</p><p>如作飞天禄马贵，失时无合空忙忙。</p><p>辛日己亥时，飞禄合局。</p><p>辛以丙为官，亥上有旺壬伤，故官无气；如再得亥月或亥日，以亥冲出巳中丙火为官星。</p><p>若是辛西、辛丑合局，贵；其余辛无合。</p><p>不通月气，无倚托，贫下；有倚托，吉。</p><p>辛丑日己亥时，辰戌丑未及寅卯月生，作飞天禄马，贵。</p><p>未月，金水运，金紫方面。</p><p>辛卯日己亥时，寅卯亥未月，财旺生官，终身有庆。</p><p>巳酉丁年月，贵。</p><p>辛巳日己亥时，填实巳字，不入飞天格，作官印论，主父母竭力扶持而后富贵。</p><p>辛未日己亥时，贵。</p><p>亥卯未寅月，金能克木，为财盛生官，名利贵显，巳午年月，富贵。</p><p>秋生，透丙，亦吉。</p><p>辛酉日己亥时，辰戌丑未、杂气财官，吉。</p><p>纯亥，冲巳中丙火为官，贵。</p><p>辛亥日己亥时，年月再亥，飞天禄马，三、四品，贵；武职极品；侯、伯。</p><p>寅巳，填实，则减。</p><p>子辰年月，亦吉。</p><p>辛日天干己亥时，枭神背禄主灾虞；无冲发福亦不重，禄马飞天贵自殊。</p><p>辛日时临己亥，枭神背禄同宫。</p><p>好如缺月被云龙。</p><p>壬巳甲寅无用。</p><p>父母完全不睦，残花结果防风。</p><p>若无克破与刑冲，飞天禄马福重。</p>",26),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","262卷 九·六辛日己亥时断.html.vue"]]);export{f as default};
